  \"2013-03-15T12:26:14.604433\",\n\t\"name\": \"accuracy-assessment-points-for-scotts-bluff-national-monument-vegetation-mapping-project\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The accuracy assessment field work was
  performed in August, 1997 to verify the accuracy of the vegetation communities spatial
  data developed by the USGS-NPS Vegetation Mapping Program for Scotts Bluff National
  Monument. The data points were randomly distributed stratified according to vegetation
  association over the project area according to protocols developed by the Program.
  Points were located by GPS navigation and the community information was collected
  at the point, without knowledge of the attributes of the vegetation spatial data.\",\n\t\"license_title\":
  null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\": \"[{\"name\":
